import React from "react";
import clipboard from "clipboard-copy";

const copy = require("clipboard-copy");

function Card(props) {
  const firstColor = props.firstColor;
  const secondColor = props.secondColor;
  const thirdColor = props.thirdColor;
  const fourthColor = props.fourthColor;

  function testlog() {
    copy("This is some cool text");
    return console.log("test");
  }

  return (
    <div class="card">
      <h2>{props.name}</h2>
      <div>
        <div
          class="color-square"
          onClick={testlog}
          style={{ backgroundColor: firstColor }}
        ></div>
        <p>{firstColor}</p>
      </div>
      <div>
        <div
          class="color-square"
          onClick={testlog}
          style={{ backgroundColor: secondColor }}
        ></div>
        <p>{secondColor}</p>
      </div>
      <div>
        <div
          class="color-square"
          onClick={testlog}
          style={{ backgroundColor: thirdColor }}
        ></div>
        <p>{thirdColor}</p>
      </div>
      <div>
        <div
          class="color-square"
          onClick={testlog}
          style={{ backgroundColor: fourthColor }}
        ></div>
        <p>{fourthColor}</p>
      </div>
    </div>
  );
}

export default Card;
